import React, { Component } from 'react';
import './App.css';
import Table from './Table';
import Header from './Header';
import Summary from './Summary';

class App extends Component {
  render() {
    return (
      <div className="container">
        <Header/>
        <Summary/>
    </div>
    );
  }
}

export default App;
